import { Drawer, Box, TextField } from '@material-ui/core';
import React from 'react';
import DrawerStyle from './customDrawer.style';

function customDrawer(props) {
    const styles = DrawerStyle();

    return (
        <Drawer
            anchor="right"
            open={props.open}
            onClose={props.handleClose}>
            <Box>
                <form>
                    <TextField id="user" label="Standard" />
                    <TextField id="email" label="Standard" />
                    <TextField id="rules" label="Standard" />
                    <TextField id="standard-basic" label="Standard" />
                </form>
            </Box>
        </Drawer>
    );
}

export default customDrawer;
